var DataOutputX = require('../io/data-outputx'),
    DataInputX = require('../io/data-inputx'),
    Service = require('./service'),
    ServiceEnum = require('./serviceenum');

function AppService() {
    Service.call(this);
};

AppService.prototype = new Service();
AppService.prototype.constructor = AppService;
AppService.prototype.getServiceType = function () {
    return ServiceEnum.APP;
};
AppService.prototype.write = function(dout) {
    Service.prototype.write.call(this, dout);
};
AppService.prototype.read = function(din) {
    Service.prototype.read.call(this, din);
    return this;
};
AppService.prototype.toString = function() {
    return 'AppService';
};

module.exports = AppService;